import React, { useEffect, useState } from "react";
import TodaysMatches from "../components/TodaysMacthes";

function IndexPage() {
  const [data, setData] = useState();

  useEffect(
    fetch("/")
      .then((res) => res.json())
      .then((data) => setData(data))
  );

  return (
    <>
      <TodaysMatches />
    </>
  );
}

export default IndexPage;
